INSERT INTO `metatags` VALUES (3,'index.php','Advogados Correspondentes Jurídicos | Ache Correspondentes em Londrina - PR','Procurando por Advogado Correspondente Jurídico? Acesse e confira nossas indicações!','advogados correspondentes, jurídico, correspondentes, brasil, londrina','True',NULL),(4,'cadastro.php','Cadastre-se como Correspondente Jurídico | Ache Correspondentes','Cadastro para Estagiários, Bachareis em Direito e Advogados. Acesse é simples e rápido!','cadastro, cadastre-se, estagiário, bacharel, advogado','True',NULL),(5,'por-que-ser-correspondente.php','Por que ser um correspondente ?','Conheça as vantagens em ser um Correspondente Jurídico. Acesse e Confira!','correspondente jurídico, vantagens, benefícios, flexibilidade, remuneração, ','True','<h2>Por que ser um correspondente?</h2> <p>A flexibilidade de horários e a remuneração imediata têm sido grande atrativo para a entrada na carreira de Profissionais Correspondentes.</p> <p>Tendo em vista que o Cliente buscador de serviços geralmente paga a vista a diligência solicitada, o Correspondente tem um retorno rápido dos valores investidos na divulgação.</p> Além disso, o Correspondente não necessita de uma estrutura física para que possa atingir sua clientela.</p> <p>Sendo assim, a Correspondência é uma ótima escolha para profissionais arrojados que busquem remuneração rápida além da expansão de seus serviços para todo o país.</p>'),(6,'quem-somos.php','Quem Somos','Conheça nossa história. ','quem somos, empresa, ache correspondentes','True','<h2>Quem Somos</h2> <p>O achecorrespondentes.com é uma empresa devidamente constituída no ano de 2010, que com ética e transparência em 2014 inicia suas atividades no âmbito “online”.</p> <p>Buscamos dia após dia a excelência em nosso sistema, objetivando ser a ponte entre os que necessitam de serviços com os que prestam o serviço desejado.</p>'),(7,'perguntas-frequentes.php','FAQ - Perguntas Frequentes','Encontre as respostas para as principais dúvidas de nossos clientes e usuários. Acesse e confira!','faq, dúvidas, perguntas frequentes','True','<h2>Perguntas Frequentes</h2> <div class=\"pergutnas\"> <p><strong>Eu pago para localizar um correspondente?</strong></p> <p>Não. O serviço de busca e contato é inteiramente gratuito.</p> <br/> <p><strong>Sou correspondente e gostaria de saber qual o valor para anunciar meu perfil no achecorrespondentes.com.br.</strong></p> <p>O cadastro é gratuito e você pode realizar seu anuncio por 20 dias de forma inteiramente gratuita! Depois de vencido o prazo da gratuidade, você receberá um email informando se deseja continuar divulgando os serviços no site. Você poderá escolher o plano desejado e depois, realizar o pagamento.</p> <p>Aproveite e conheça desde já os planos de divulgação.</p> <br/> <p><strong>Já realizei meu cadastro, porém não realizei ainda o pagamento do meu plano, o que devo fazer?</strong></p> <p>Seja bem vindo! Você deve acessar o site realizando digitando seu Login e senha.</p> <p>Você será redirecionando para a Área do Correspondente.</p> <p>Acesse a Opção Pagamentos -> Pagamentos Pendentes. </p> <p>Escolha a forma de pagamento e pronto! Você terá automaticamente o seu nome incluído no achecorrespondentes.com.br.</p>'),(8,'contato.php','Fale Conosco','Entre em contato com a nossa equipe para sanar suas dúvidas!','fale conosco, contato, telefone, e-mail','True',NULL),(9,'anuncie.php','Anuncie e Seja Parceiro','Anuncie em uma plataforma segmentada. Clique e conheça!','anuncie, parceiro, seja parceiro','True','<h2>Anuncie e Seja Parceiro</h2> <p>O Achecorrespondentes.com.br é divulgado em todo o país e possui como clientes e parceiros, milhares de pessoas financeiramente ativas.</p> <p>Se você deseja anunciar em nosso site, redes sociais, blog , mailing, ou ainda realizar uma outra forma de parceria de sucesso, nos envie um e-mail com sua idéia e responderemos o quanto antes, informando sobre sua viabilidade.</p> <p>Agradecemos desde já.</p> <p>Equipe de Divulgação achecorrespondentes.com.br</p>'),(10,'termos-de-uso.php','Termos de Uso','Conheça os Termos e Condições de Uso do Ache Correspondentes','termos de uso, condições de uso','True','<h2 align=\"center\" style=\"text-transform: uppercase;\"><b>Termos de Uso</b></h2> <p>Domínio <b>www.achecorrespondentes.com.br</b>, neste ato representado por F. B. PULLIN DE ARAUJO – ME, pessoa jurídica de direito privado, inscrita no CNPJ sob nº 11.975.185/0001-76, com sede e foro em Londrina – Paraná, ora em diante apenas denominado <b>SITE</b>.</p> <br/> <p>Profissionais Correspondentes, ofertantes de serviços jurídicos, sejam pessoas físicas ou jurídicas, ora em diante apenas denominados <b>CORRESPONDENTES</b>.</p> <br/> <p>Cliente Solicitante de Serviços Jurídicos, aos CORRESPONDENTES, ora em diante apenas denominado <b>CLIENTE</b>.</p> <br/> <p style=\"text-align: justify;\">O objetivo do SITE é a publicação dos dados cadastrados dos CORRESPONDENTES na internet, demonstrando, a comarca de atuação além de seus contatos. O SITE não é prestador de serviços jurídicos e não recebe qualquer valor a título de comissão e/ou honorários de CORRESPONDENTES e CLIENTES. Para a utilização dos serviços de publicação, o CORRESPONDENTE pagará ao SITE, conforme a tabela de valores vigente no período, e deverá manter em dia suas obrigações sob pena de exclusão. O CORRESPONDENTE se compromete, a fornecer todos os dados cadastrais de modo correto, declarando a veracidade de todos, mantendo-os atualizados e garantindo a formação e conhecimento para a realização dos serviços ofertados. O CORRESPONDENTE só poderá realizar um (01) cadastro por Cadastro de Pessoa Física (CPF), sob pena de bloqueio e exclusão de cadastro. O CORRESPONDENTE autoriza a publicação de seus dados em empresas parceiras que divulguem seus serviços, bem como, autoriza o recebimento de e-mails de empresas parceiras que lhe desejem ofertar algum produto ou serviço. A qualquer momento o CORRESPONDENTE poderá solicitar o cancelamento de seu cadastro, enviando e-mail para <a href=\"contato.php\"><b>contato@achecorrespondentes.com.br</b></a>, com o título: “CANCELAMENTO DE CADASTRO”. Após a solicitação, o SITE realizará a exclusão do cadastro do CORRESPONDENTE no prazo de 05 dias úteis. Após exclusão, o cadastro não estará mais disponível para visualização nas buscas realizadas pelo CLIENTE. Caso o CORRESPONDENTE tenha adquirido e pago algum Plano que ainda esteja vigente, a solicitação de cancelamento ocasionará reembolso dos valores pagos e não gozados pelo CORRESPONDENTE, excluídos multa equivalente a 20% (vinte por cento) em favor do SITE, em virtude da rescisão unilateral. O SITE não realiza a conferência dos dados fornecidos pelos CORRESPONDENTES, assim como não é responsável pela veracidade dos dados cadastrados pelo mesmo. Portanto, é dever do CLIENTE conferir e/ou atestar a veracidade de ditos dados. O CORRESPONDENTE fica ciente de que poderá receber solicitações de serviços jurídicos por meio de e-mail, site, telefone fixo e telefone celular. O SITE não é responsável por nenhum serviço prestado pelo CORRESPONDENTE, bem como por qualquer solicitação realizada pelo CLIENTE. O CORRESPONDENTE é o único responsável pela realização e cumprimento das diligências contratadas. Toda e qualquer negociação, solicitação e pagamento fica sob a responsabilidade do CORRESPONDENTE e do CLIENTE, eximindo assim o SITE de toda e qualquer responsabilidade proveniente de ações ou omissões praticadas. Em caso de descumprimento de legislação vigente, de diligências, de regras deste termo, do Código de Ética da OAB, ou dos bons costumes, o CORRESPONDENTE poderá ser excluído do SITE. A exibição dos dados dos CORRESPONDENTES fica a critério do SITE, que colocará em destaque ou não o cadastro conforme o que entender, em virtude de pagamento de taxa adicional, avaliação de clientes e critérios meritórios. Fica resguardado o direito do SITE, realizar modificações em qualquer configuração da sua página de internet, bem como, alterar cláusulas e regulamentos em qualquer tempo. O SITE, não se responsabiliza por ação ou omissão, tanto do CORRESPONDENTE quanto do CLIENTE, as quais gerem dano, em virtude de morosidade nas transmissões, bloqueio, queda ou qualquer outro fato que esteja fora do alcance do seu controle. Qualquer pagamento, do CORRESPONDENTE ao SITE, é intermediado pelas empresas PAG SEGURO e BCASH, sendo ambas as responsáveis pelo processamento e concretização dos trâmites financeiros, inclusive reembolso em caso de crimes virtuais e fraudes. É Expressamente proibida a cópia e utilização dos dados do SITE para outros fins, que não os estipulados neste documento. Fica eleito o foro da Comarca de Londrina, Estado do Paraná, para a resolução de qualquer controvérsia decorrente deste TERMO DE USO.</p>'),(11,'blog.php','Notícias | Advogados Correspondentes Jurídicos','Leia notícias e novidades a respeito do mercado de Correspondentes Jurídicos. Acesse e confira!','notícia, blog, novidades','True',NULL),(12,'correspondentes.php','Lista de Advogados Correspondentes Jurídicos','Confira a relação completa de nossos Correspondentes Jurídicos.','lista completa, advogados, correspondentes, jurídicos','True',NULL),(13,'adm/','ADMINISTRAÇÃO - www.achecorrespondentes.com.br','Páginas administrativas','administração,achecorrespondentes,com,br','True',NULL);

