INSERT INTO `noticias` VALUES (3,'STF reconhece natureza autônoma dos honorários advocatícios','Brasília – Na tarde desta quinta-feira (30), o plenário do Supremo Tribunal Federal (STF) decidiu que os honorários advocatícios têm natureza autônoma e podem ser executados e levantados separadamente, inclusive via Requisição de Pequeno Valor (RPV). “O STF reconhece assim a essencialidade do advogado, bem como o entendimento da OAB Nacional e de toda a advocacia brasileira sobre a natureza dos honorários”, destacou o presidente nacional da OAB, Marcus Vinicius Furtado Coêlho , no julgamento em repercussão geral do Recurso Extraordinário 564.132. O presidente destacou, ainda, que a decisão trata-se de mais uma importante vitória para a classe. “Suponhamos que um determinado precatório tenha um valor que supere o teto da RPV, porém, o valor da verba honorária, por ser menor do que a condenação principal, está situado na faixa perceptível por RPV. Assim, é direito do advogado requerer o pagamento direto. Esta é uma grande conquista, pois ao reconhecer a natureza autônoma, ou seja, de pertencimento ao advogado, se reconhece também a natureza alimentar”, apontou. O presidente da Comissão Especial de Defesa dos Credores Públicos da OAB, Marco Antonio Innocenti, entende que \"o julgamento do STF consolidou o entendimento de que o pagamento dos honorários têm prioridade em relação aos créditos de precatórios e RPVs, sendo autônomos e independentes do crédito do constituinte. Milhares de processos deverão alcançados e essa orientação deverá ser incorporada às normas regimentais de todos os tribunais\". Em seu voto, a ministra Rosa Weber também lembrou que a natureza da verba honorária é autônoma e alimentar. “Sem dúvidas, os artigos 23 e 24 do Estatuto da Ordem dos Advogados do Brasil velam que os honorários são do advogado, sendo desprovidos de qualquer caráter acessório que se queira a eles associar. Exatamente pela natureza autônoma da verba, não se pode falar em desrespeito ao artigo 100, parágrafo 8º, da Constituição Federal”, disse. “A decisão guarda também similitude com julgado recente do Órgão Especial do STJ no mesmo sentido, bem como com o que regula expressamente o Novo Código de Processo Civil”, destacou o presidente. A OAB Nacional atuou como amicus curiae atendendo pleito da seccional gaúcha da entidade. Fonte da Notícia e da Foto http://www.oab.org.br/noticia/27758/stf-reconhece-natureza-autonoma-dos-honorarios-advocaticios',NULL,'stf-nelson-jr-1604972650.jpg','2014-11-03'),(4,'Os 15 advogados mais poderosos do Brasil','Se todos têm direito à defesa, logo todos têm direito a um advogado. A depender do tamanho da conta bancária do cliente, é possível ter os melhores à disposição. GQ consultou os mais tradicionais escritórios brasileiros para saber quem são os advogados mais renomados, reconhecidos e poderosos do país, em seis áreas do direito. (Os escritórios consultados foram Trench, Rossi e Watanabe; Demarest; Pinheiro Neto; Machado, Meyer, Sendacz e Opice; Levy & Salomão; Leite, Tosto e Barros; Duarte Garcia, Caselli Guimarães e Terra; Martinelli; e Silveira, Athias, Soriano de Mello, Guimarães, Pinheiro e Scaff.) Márcio Thomaz Bastos Penal No início dos anos 2000 Thomaz Bastos já ostentava a fama de ser um dos mais renomados criminalistas do Brasil. Já defendeu o bispo Edir Macedo, líder da Igreja Universal do Reino de Deus, e o médico Roger Abdelmassih, condenado a 278 anos de prisão por ter abusado sexualmente de clientes de sua clínica de fertilização. Também acusou os assassinos do seringueiro Chico Mendes, Darly e Darcy Alves Ferreira, e o algoz de Sandra Gomide, o jornalista Antônio Pimenta Neves – atuou como assistente da promotoria em ambos. Em 2003, sua extensa biografia foi ampliada ao assumir o Ministério da Justiça. Desde então, boa parte da cúpula petista, a começar pelo ex-presidente Lula, não dá um passo sem consultá-lo. A proximidade com a política rendeu-lhe a condição de um dos advogados mais bem pagos do país. Prova disso é a aquisição da sede própria do escritório que mantém com dois sócios, um andar inteiro de um prédio de alto padrão na Avenida Faria Lima, em São Paulo, por R$ 2,8 milhões. Especula-se que só a defesa do bicheiro Carlinhos Cachoeira tenha custado R$ 15 milhões em honorários. De homicidas a bicheiros, Bastos, hoje com 79 anos, costuma dizer que só recusa casos de acusados de crimes violentos contra crianças. Pierpaolo Cruz Bottini Penal Desde o fim de 2012, o jovem advogado Bottini pode exibir em seu currículo o feito de ter conseguido a absolvição de seu cliente, o ex-deputado Professor Luizinho (PT-SP), no ruidoso processo do mensalão. Com um detalhe: foi o único dos poucos réus que escaparam da condenação com o voto favorável do implacável relator da ação e presidente do Supremo, Joaquim Barbosa. Para Pierpaolo, o mensalão pode ser considerado um divisor de águas em sua carreira de criminalista. “Teve gente que assistiu à minha sustentação pela TV Justiça e me ligou para me contratar”, conta. O trabalho foi árduo. Na véspera do início do julgamento, o advogado costumava colocar o filho, de apenas 6 meses, sentado no sofá para treinar o que diria aos 11 ministros no plenário do tribunal – a ponto de muitos acreditarem que a primeira palavra do menino seria “mensalão”. Apesar do êxito de sua atuação, a carreira do criminalista de 37 anos é recente. Começou logo após sua saída do Ministério da Justiça, junto com seu mentor, Márcio Thomaz Bastos. Pelas mãos do então ministro da Justiça foi levado a integrar a equipe do primeiro mandato do governo Lula. De tão jovem, o time montado pelo ex-ministro foi apelidado de “berçário de Thomaz Bastos” na Esplanada dos Ministérios. Francisco Müssnich Operações financeiras Os últimos meses na vida de Müssnich foram de muito trabalho. Seu escritório foi escolhido pelo Comitê Organizador Local da Copa, o que o colocou à frente de todas as questões jurídicas do segundo maior evento esportivo do mundo. Qualquer contrato do COL – até a compra de material de escritório – passou pelo escritório. Antes da Copa, ele já havia atuado para a CBF e seu ex-presidente, Ricardo Teixeira. Aos 59 anos, é conhecido por ser um solucionador de problemas e por ter participado de alguns dos mais ruidosos negócios ocorridos no Brasil. Um deles foi com André Esteves, o banqueiro que em 2006 vendeu o Banco Pactual para o suíço UBS por US$ 3,1 bilhões e três anos depois o recomprou por US$ 2,5 bilhões. \"Não adianta ser competente, tem que ter estrela, como o Esteves”, diz. Ele também atuou na venda da Brasil Telecom, em 2008. Durante cinco dias, chegou a tomar banho no escritório do cliente e foi para casa só duas vezes. “Me considero um workaholic, mas tento fazer disso uma coisa prazerosa.\" Arnoldo Wald Cível Todo mundo conhece alguém que tenta recuperar parte dos rendimentos da poupança perdida durante os planos econômicos das décadas de 80 e 90 na Justiça. Afinal, são 400 mil processos em todo o país e uma conta de R$ 150 bilhões a ser paga pelos bancos, caso os poupadores saiam vitoriosos. O que poucos sabem é que, na outra ponta da maior disputa judicial em andamento no país, está Arnoldo Wald. O advogado, de 81 anos, defende a Confederação Nacional do Sistema Financeiro (Consif) na ação que corre no Supremo e que dará a palavra final sobre a validade da correção das cadernetas, feita por um índice abaixo da inflação. A correção da poupança é certamente o maior caso em que Wald atua, mas ações bilionárias não são exatamente uma novidade para ele. Apenas um de seus clientes – a Varig – pleiteia no Supremo uma indenização de R$ 6 bilhões da União pelos prejuízos causados pelo congelamento de preços das passagens aéreas durante os anos 80 e 90. Jairo Saddi Contratos comerciais Foi na década de 90, em meio à crise que levou vários bancos à falência, que Saddi recebeu o telefonema de um banqueiro perguntando se estava indo almoçar. Já no restaurante, o cliente disse que não havia jantado no dia anterior e não tinha dinheiro para o almoço. “Todos os seus bens estavam bloqueados pela Justiça.” Saddi pagou a conta do hoje ex-banqueiro, um dos muitos com quem conviveu na carreira. Pelas mãos do advogado já passaram 40 liquidações de bancos, a maior delas envolvendo R$ 2,7 bilhões. Somente no caso do falido Banco Santos, Saddi representa clientes com R$ 1 bilhão a receber. Especialista em direito bancário, autor de nove livros e presidente do conselho da escola Insper Direito, ele já atuou para todos os grandes bancos do país. Daí porque coleciona histórias curiosas como a do almoço pago ao banqueiro falido. Ou quando foi padrinho do casamento do maior credor de um banco com a filha do ex-banqueiro devedor. O relacionamento começou no auge do litígio e ainda resultou em um acordo entre credor e devedor. Édis Milaré Meio ambiente Até agora a Justiça contabiliza 23 ações civis públicas abertas contra a construção de Belo Monte, a terceira maior usina hidrelétrica do mundo. Em todas elas, o consórcio Norte Energia, responsável pela obra, conta com a experiência de Édis Milaré na defesa do projeto. Aos 70 anos, ele é um dos mais reconhecidos advogados da área de meio ambiente do Brasil – além de Belo Monte, atua para Vale, Suzano e Camargo Corrêa. Mas nem sempre foi assim. Milaré passou boa parte de sua carreira do outro lado do balcão, como promotor do Ministério Público de São Paulo. Lá, foi o responsável pela proposição da primeira ação civil pública destinada a ressarcir, aos cofres públicos, os prejuízos causados por danos ambientais provocados por empresas, ainda em 1983. A ação, aberta contra uma empresa que asfaltava a recém-construída estrada Rio-Santos e, na explosão de uma pedreira, acabou atingindo um duto da Petrobras, espalhando óleo pelos cursos d’água e manguezais da região de Bertioga, não deu em nada. Mas inaugurou uma nova era para o Ministério Público de todo o país, que passou a atuar também na defesa do meio ambiente. Em 1995, Milaré deixou o MP e passou a advogar. \"Estou em outra posição, mas sem trair meus princípios\", diz o advogado, que garante não serem poucos os trabalhos que recusou em sua carreira. \"A primeira pergunta que faço é: você está disposto a resolver o problema?\" Marcelo Ferro Cível Entre seus clientes estão nada menos do que cinco das maiores construtoras do país: Camargo Corrêa, Queiroz Galvão, OAS, Andrade Gutierrez e Odebrecht. No caso da Odebrecht, Ferro advoga para várias empresas do grupo e frequenta a casa da família baiana – embora isso se deva mais a uma relação de parentesco (seu irmão é casado com uma irmã de Emílio Odebrecht). Não é o caso da amizade com Abílio Diniz, ex-dono do Grupo Pão de Açúcar e presidente do Conselho de Administração da Brasil Foods. Foi Ferro quem defendeu Diniz na disputa com Arthur Sendas, então dono do Grupo Sendas, que se associou ao Pão de Açúcar em 2003. Os dois ícones do varejo brasileiro se engalfinharam numa disputa societária em 2007 que culminou na venda do Sendas ao grupo paulista em 2011. Na época, Diniz achou Ferro jovem demais (hoje tem 50 anos). Depois do litígio, nunca mais largou o advogado, acionado em todas as disputas que patrocina. Entre elas, o litígio com a ex-dona do Ponto Frio, Lily Safra. \"Em matéria de briga, sou advogado do Abílio.\" Antonio Carlos de Almeida Castro Penal Ele tem fama de petista pela proximidade com o ex-todo-poderoso José Dirceu. Mas, aos 56 anos, sua contabilidade acusa a defesa de 17 ministros do governo FHC e de apenas 8 de Lula. Conhecido como Kakay, é o criminalista mais requisitado de Brasília, onde o que não falta é serviço. José Sarney e a filha Roseana, Demóstenes Torres, Marconi Perillo e Antônio Carlos Magalhães são apenas alguns dos que deixaram sua defesa nas mãos dele. Ao custo, claro, de honorários milionários que garantem o caríssimo estilo de vida do advogado, dono de uma mansão à beira do Lago Paranoá, em Brasília, cuja porta de entrada é guardada por um rinoceronte esculpido em bronze e que abriga uma adega de dois andares e 4 mil rótulos. De Paris, onde passa parte de suas férias, Kakay conta que sempre quis “viver do crime”, mas aceita advogar em outras áreas do direito se o caso é interessante. Talvez essa abertura tenha motivado um empresário paulista a procurá-lo para fazer sua defesa no processo de divórcio que travava com a ex-mulher, magoada pela descoberta de uma amante. A ex contratou Priscila Fonseca, renomada advogada de família conhecida por limpar o cofre de ex-maridos. E o empresário implorou para que Kakay o defendesse. Diante da recusa, ofereceu 20% dos R$ 3 bilhões que mantinha no exterior em caso de vitória. Mais uma resposta negativa e o empresário, desesperado com o risco de perder metade de sua fortuna, apelou: “Se você não me defender vou matá-la”. “Bem, aí é minha área”, respondeu, em tom de brincadeira. Ele não pegou o caso, mas nenhum crime aconteceu. Sérgio Bermudes Cível Qual é o pior cliente que um advogado pode ter? Hoje, certamente, um deles é Eike Batista, que sonhava ser a pessoa mais rica do mundo em 2015 e, no ano passado, perdeu US$ 28,8 bilhões, tornando-se um devedor. Pois Bermudes, de 68 anos, é quem tem a árdua tarefa de auxiliar o empresário a equacionar suas dívidas e sair do buraco. O advogado é o responsável pelo pedido de recuperação judicial da OGX, empresa de petróleo de Eike Batista que em 2008 fez uma das maiores ofertas de ações da história da bolsa de valores brasileira, captando R$ 6,7 milhões, e que, em outubro do ano passado, informou ao mercado que não pagaria suas dívidas. Com isso, no entanto, o advogado não se preocupa. Ele conta que já foi pago com rapadura pela mãe de um rapaz que não tinha dinheiro para bancar a defesa e com sonhos recheados de camarão, feitos por uma cliente desalojada de sua casa. Mas diz que, de cliente abastado, nunca levou calote. “Os ricos sempre me pagaram, graças a Deus!” José Roberto Opice Operações financeiras Se hoje a Ambev é a empresa brasileira com maior valor de mercado, superando os US$ 110 bilhões, parte desse sucesso deve-se a Opice, sócio do Machado Meyer, Sendacz e Opice Advogados, um dos maiores escritórios do país. Foi ele quem orquestrou, em 2004, a fusão da companhia com a belga Interbrew, que culminou na criação da maior fabricante de bebidas do mundo. Nada na operação foi fácil, conta o advogado responsável pela primeira união de uma gigante brasileira com uma estrangeira. O grau de dificuldade de uma operação desse porte é enorme, mas não chega a ser novidade para Opice. Ele foi um dos principais advogados do consórcio de empresas contratado pelo governo em 1997 para moldar a venda da Vale. Isso em um momento em que privatização era palavrão e gerava enorme polêmica. “Foi muito dramático”, diz. A dedicação fora do comum e o intenso ritmo de trabalho era costume. No mesmo ano, participou da venda do Bamerindus ao HSBC. “Criamos um banco em 24 horas”, conta. A última grande operação em que atuou – a venda do Grupo Ipiranga por R$ 4 bilhões – rendeu-lhe um problema na coluna. Aos 68 anos, Opice tem hoje uma rotina mais leve e já prepara sua aposentadoria, que deve ocorrer em dois anos. “O advogado de negócios tem um limite de idade.” Paulo Valois Infraestrutura Quando se preparava para escolher a profissão que seguiria, Valois ficou entre o direito e a diplomacia. Optou pela primeira carreira, mas não se esquivou da segunda. Aos 48 anos, passa metade de seu tempo viajando e apresentando o Brasil a investidores estrangeiros. Não como embaixador, mas um dos advogados do país que mais entende de petróleo e gás, setor que deve atrair R$ 458 bilhões em investimentos até 2018. A especialização de Valois ocorreu por acaso – seu primeiro estágio foi na Interbras, trading de petróleo da Petrobras. Depois passou pela Shell e estudou na França e nos Estados Unidos. Em 1997, quando a Lei do Petróleo expandiu a atuação de empresas privadas, abriu o primeiro escritório dedicado à área de recursos naturais do mercado brasileiro. Hoje é sócio do L.O. Baptista, Schmidt, Valois, Miranda, Ferreira, Agel Advogados e tem, em seu currículo, a vitória pelo livre acesso ao gasoduto Bolívia-Brasil travada entre suas clientes BG e Enron e Petrobras. Nelson Eizirik Contratos comerciais Menos de uma semana antes do anúncio da fusão entre o Itaú e o Unibanco, em 3 de novembro de 2008, um pequeno grupo de advogados foi chamado para redigir e revisar os contratos que criariam o maior banco do Hemisfério Sul. Entre eles estava Nelson Eizirik, hoje com 64 anos, um dos maiores especialistas brasileiros em sociedades anônimas, posição que disputa com seu sócio, Modesto Carvalhosa, ambos titulares da banca Carvalhosa e Eizirik Advogados. Ele conta que a fusão foi feita em apenas um fim de semana. Nesse período, ficou à disposição das famílias Moreira Salles e Setubal para finalizar o negócio, engendrado em completo sigilo ao longo de meses, sempre em reuniões na mansão de um dos executivos do Itaú, que ganhou o codinome de “hotel” para evitar o vazamento da operação. Autor de 20 livros e ex-diretor da Comissão de Valores Mobiliários, Eizirik, acostumado a lidar com as mais complexas questões societárias, diz que a união dos dois concorrentes foi tranquila. “Foi tão pacífico que não tinha quase nada para fazer.” José Luís de Oliveira Lima Penal Aos 47 anos, Oliveira Lima tornou-se um dos criminalistas mais requisitados do país durante o mensalão. É de Juca, como é chamado, a defesa do réu mais importante do processo: José Dirceu. O ex-chefe da Casa Civil de Lula chegou a ele por indicação de seu tio, o criminalista José Carlos Dias, ex-ministro da Justiça de FHC. Em 2006, quando o Ministério Público ofereceu denúncia à Justiça acusando um esquema de compra de votos no Congresso, Dirceu procurou Antônio Carlos de Almeida Castro, o Kakay, para se aconselhar. Diante do viés político do caso, Kakay recomendou contratar um advogado próximo aos tucanos – e indicou José Carlos Dias. Já comprometido com a defesa do Banco Rural no processo, o tio indicou Juca. Foi um salto em sua carreira, mas também sua maior derrota. “É inegável que foi uma derrota, e sofro com ela”, admite. Hoje amigo de Dirceu, Juca o visita na prisão pelo menos uma vez por semana e diz que o momento mais difícil foi ter que entregá-lo na cadeia. “Nunca tinha passado por isso.” Carlos Ari Sundfeld Infraestrutura Qualquer brasileiro com mais de 35 anos se lembra da patética situação de ter que entrar numa fila para comprar uma linha telefônica e aguardar anos até ser contemplado. Se hoje bastam apenas alguns dias para viabilizar isso, boa parte do mérito é de Sundfeld. O advogado é o autor da Lei Geral de Telecomunicações, em vigor desde 1997, que permitiu a privatização da Telebras, a abertura do mercado e a criação da primeira agência reguladora do país, a Anatel. A missão de reformular a lei foi dada pelo já falecido Sérgio Motta, o ministro das Comunicações de FHC, com um pedido especial para que dispensasse a Anatel de fazer licitações, o que contrariaria a Constituição. A resposta do jurista foi a criação do pregão, mecanismo inédito que, de tão eficiente, foi estendido a todo o governo pouco tempo depois. Aos 53 anos e do alto de sua sabedoria sobre o setor de telecomunicações, Sundfeld parece não usufruir de sua criação: “Não tenho celular e nem sei de cor o telefone de casa”. Arnaldo Malheiros Filho Penal Se existisse um top of mind para classificar os criminalistas mais lembrados, Malheiros Filho estaria, sem dúvida, no topo da lista. Considerado um dos melhores do país, o advogado já defendeu Paulo Maluf, Orestes Quércia e Fernando Henrique Cardoso, além do ex-tesoureiro do PT Delúbio Soares, para quem advoga no processo do mensalão. Como advogar para personagens tão diversos e controversos? “Tendo uma atitude profissional e nenhum envolvimento com a política”, diz ele. Apesar da quantidade de políticos no portfólio de clientes, é no meio empresarial e financeiro que o advogado se sobressai. Defendeu a já falecida Eliana Tranchesi, a ex-dona da butique de luxo Daslu, presa em 2005 por sonegação fiscal na ruidosa Operação Narciso, realizada pela Polícia Federal, e o banqueiro Edemar Cid Ferreira, o ex-dono do falido Banco Santos. Hoje Malheiros tem seu ganha-pão defendendo clientes abastados, mas nem sempre foi assim. Ele conta que certa vez recebeu indicação por um juiz para defender um réu que, abordado por quatro policiais, atirou em todos e acabou preso com 30 quilos de maconha. Ao visitá-lo no Carandiru, o cliente disse que na verdade tinha 60 quilos da droga, e que a outra metade, escondida, seria do advogado se ele o tirasse da prisão. Malheiros acabou saindo do caso. Fonte Texto e Foto: http://gq.globo.com/Prazeres/Poder/noticia/2014/08/os-15-advogados-mais-poderosos-do-brasil.html',NULL,'marcio-thomas-bastos.jpg','2014-11-04'),(5,'Os sete hábitos do advogado bem-sucedido','Não existe atalho algum para o desenvolvimento. A lei da colheita nos governa. Sempre colhemos o que semeamos - nem mais, nem menos\". É isso que afirma o autor Stephen Covey do livro Os Sete Hábitos das Pessoas Muito Eficazes. Ele defende que os modelos mentais são as lentes através das quais vemos o mundo, o que determina o nosso modo de pensar e de agir. Isso quer dizer que enxergamos o mundo não exatamente como ele é, mas como nós estamos condicionados a vê-lo. A experiência do referido autor com treinamento de executivos em cem das quinhentas maiores empresas listadas pela revista Fortune, permitiu-lhe demonstrar que sete hábitos distinguem as pessoas bem sucedidas: a conduta pró-ativa, o estabelecimento de objetivos, a capacidade de priorização, a postura ganha-ganha, a atitude de primeiro compreender e depois buscar ser compreendido, a sinergia e a renovação. Tais hábitos valem para todo e qualquer ser humano que pretenda desenvolver sua vida sob o manto da eficácia. E, se nós somos as criaturas do hábito, consequentemente, serão eles que irão definir quem nós somos. Nido Qubein, consultor internacional, costuma afirmar que \"bons hábitos são de difícil desenvolvimento, mas de fácil convivência; maus hábitos são de fácil desenvolvimento, mas de difícil convivência\". Pense no hábito da leitura, no hábito de construir e desenvolver relacionamentos, no hábito de chegar atrasado aos compromissos, no hábito da organização pessoal, etc. No caso da Advocacia, da mesma forma, são os nossos hábitos como profissionais do Direito que irão definir o futuro de nossas carreiras. E pensando em quais hábitos teriam o condão de fazer um advogado ser bem sucedido ou não, sugerimos os seguintes: 1. Leia pelo menos uma hora por dia. Leia de tudo, não apenas textos jurídicos. Amplie o seu conhecimento sobre o mundo, amplie sua cultura geral, conheça mais sobre os negócios dos seus clientes. Leia no trânsito (se não estiver dirigindo, claro), no avião, na sala de espera do médico. Leia sobre assuntos que sejam inspiradores. 2. Seu sucesso depende de suas escolhas. Isso não tem nada a ver com as circunstâncias em que você se encontra, mas com relação aos \"nãos\" que você diz ao longo da vida. Escolha bem o seu sócio, os seus advogados associados, os seus estagiários, a sua secretária, a área do Direito em que você vai atuar, os seus investimentos, o perfil dos seus clientes. E lembre-se: existem escolhas que nos acompanham pelo resto de nossas vidas. É preciso ter coragem para tomar os melhores caminhos. 3. Fale com as pessoas. Separe um tempo, todos os dias, para ligar para 4 pessoas (clientes, colegas, parceiros, amigos, etc.). Isso significa 20 pessoas por semana, 1.000 pessoas no ano. Não importa a razão do seu contato, ligue apenas para perguntar se estão bem, se os negócios vão bem, se a família vai bem. Sabiamente, já diziam os mais antigos: \"quem não é visto, não é lembrado\". 4. Seja organizado. Mantenha sua mesa de trabalho limpa. Todos os dias. Não saia do escritório sem deixá-la organizada para o dia seguinte. Habitue-se a só conseguir trabalhar se tudo estiver impecavelmente no lugar. Nada de montanhas de papel na sua frente! 5. Construa sua reputação. Se alguém perguntar sobre você para algum de seus clientes, o que ele falaria? Será que na sua frente ele diria uma coisa, e na sua ausência outra? Ser ético é um hábito; ser honesto é um hábito; ser sincero é um hábito; ser justo é um hábito. Se nos acostumamos a agir sabendo que qualquer deslize pode por fim a uma reputação ilibada, seguramente trataremos de construir a nossa com muito cuidado e zelo. 6. Aprenda. Todos os dias, antes de dormir, pergunte a si mesmo: \"o que eu aprendi hoje?\". Experimente aprender algo novo todos os dias. Quanto mais você sabe, mais você será capaz de aplicar seus conhecimentos no seu dia-a-dia. Aprenda uma nova função do seu editor de texto, aprenda uma nova língua, aprenda a tocar um instrumento, aprenda uma forma nova de gerenciar seu escritório. 7. Ensine. Use todo o seu conhecimento, armazenado e construído por anos a fio para transformar as vidas dos profissionais que o cercam. Compartilhe com a sua equipe a sua visão sobre a advocacia, sobre aquela tese de Direito Tributário que você tanto estudou, sobre como se preparar para uma sustentação oral, sobre como tratar o cliente. Ser um advogado bem-sucedido, ao contrário do que muitos possam pensar, está muito distante do imediatismo ou do \"lance de sorte\" que faz trazer para o escritório o patrocínio \"daquele\" inventário, \"daqueles\" honorários de sucumbência e \"daquele\" contrato, cujas cifras sejam milionárias. Ser um advogado bem-sucedido é fazer com que as oportunidades permitam que tudo isso aconteça, mas, que por trás das cifras milionárias, o cliente possa encontrar um profissional que, antes de tudo e durante todo o curso de sua carreira, tem por hábito preocupar-se com o seu autodesenvolvimento e de sua equipe, que tem por hábito pautar sua conduta nos princípios fundamentais da saudável convivência humana. Assim, é preciso rever os hábitos de hoje, pois, sem dúvida alguma, essa é a matéria-prima do seu destino... Do seu futuro. Lara Selem é advogada e consultora em Gestão de Serviços Jurídicos. Executive MBA pela Baldwin Wallace College (EUA), especialista em Gestão de Serviços Jurídicos pela FGV-EDESP (SP). Autora dos livros \"Estratégia na Advocacia\" (Ed. Juruá, 2003), \"Gestão Judiciária Estratégica\" (ESMARN, 2004), \"A Reinvenção da Advocacia\" (Forense/Fundo de Cultura, no prelo). Fonte: CATHO EDUCAÇÃO EXECUTIVA - Cursos Online, Cursos executivos, Cursos de formação, MBA, MBA Online, Artigos Fonte Texto: http://www.catho.com.br/cursos/advogado',NULL,'','2014-11-04'),(6,'Deu no G1: OAB considera mais importante conteúdo da reforma política','Brasília - Leia a notícia publicada nesta segunda-feira (03) no site G1 com o título \"OAB considera secundário plebiscito ou referendo para a reforma política\": O presidente da Ordem dos Advogados do Brasil (OAB), Marcus Vinícius Coêlho, afirmou nesta segunda-feira (3), durante ato público em Brasília, que é secundário, neste momento, debater se uma eventual proposta de reforma política deve ser submetida a um plebiscito ou a um referendo. A presidente Dilma Rousseff voltou a defender, no dia em que foi reeleita, a realização de um plebiscito para promover a reforma política, no entanto, integrantes do Congresso Nacional admitem, no máximo, submeter as propostas a um referendo. A OAB tenta viabilizar, ao lado da Conferência Nacional dos Bispos do Brasil (CNBB) e do Movimento de Combate à Corrupção Eleitoral, a tramitação de um projeto de lei de iniciativa popular para alterar pontos do sistema político e eleitoral brasileiro. Nesta segunda, a entidade dos advogados pediu o apoio da sociedade para coletar as 1,5 milhão de assinaturas necessárias para protocolar o projeto de reforma política no Legislativo, equivalente a 1% do eleitorado do país. “A discussão de plebiscito ou referendo é uma discussão final, e não inicial. Não é uma discussão de forma que vai atrapalhar o debate do conteúdo, que é o principal para o que queremos com o Brasil”, ressaltou Coêlho durante ato organizado pela Coalização pela Reforma Política Democrática e Eleições Limpas, que conta com a participação de 101 entidades, além de movimentos e organizações sociais. O projeto capitaneado pela OAB, pela CNBB e pelo Movimento de Combate à Corrupção Eleitoral foi apresentado no ano passado, após a onda de manifestações que tomou conta do país. A proposta prevê, entre outros pontos, o fim do financiamento de campanhas eleitorais por empresas privadas, eleições proporcionais em dois turnos, paridade de gêneros na lista pré-ordenada e maior participação da sociedade em decisões nacionais importantes. Segundo o representante da OAB na Coalização, Aldo Arantes, o movimento já conta com cerca de 520 mil assinaturas. A coleta tem sdio feita tanto presencialmente quanto de forma eletrônica. Para o presidente da OAB, a meta do movimento é coletar as assinaturas restantes nos próximos 30 dias, ainda que o prazo final estipulado pelas entidades seja 1º de fevereiro, data em que terá início a próxima legislatura do Congresso.	\"Um projeto de lei consegue ser aprovado com muito mais simplicidade no Congresso porque basta uma maioria que não é qualificada. E assim a mobilização da sociedade será suficiente para convencer os deputados e senadores a aprovarem uma reforma\", destacou Coêlho. Fonte Texto: http://www.oab.org.br/noticia/27777/deu-no-g1-oab-considera-mais-importante-conteudo-da-reforma-politica',NULL,'','2014-11-04'),(7,'Faculdade terá de indenizar aluno por encerramento repentino de curso','Embora a instituição educacional, no exercício da autonomia universitária, tenha o direito de extinguir cursos superiores, isso não exclui a possibilidade de ser obrigada a indenizar seus alunos. A Terceira Turma do Superior Tribunal de Justiça (STJ), ao julgar recursos originados de uma ação proposta por estudante do curso de administração de empresas da Faculdade São Luís, de São Paulo, decidiu que a indenização é cabível se a instituição encerra o curso de maneira abrupta, deixando de fornecer adequada e prévia informação ao aluno, e não oferece alternativas nas mesmas condições para que ele possa continuar seus estudos. Transferência: Pouco mais de um ano após o ingresso do aluno na faculdade, ele recebeu uma notificação da instituição sobre o encerramento de seu curso e sobre dois convênios firmados com outras instituições que ofereciam o mesmo curso. Todavia, conforme os autos, apenas uma das instituições mantinha convênio para o curso de administração de empresas, enquanto a outra conveniada assumiu apenas os alunos do curso de ciências contábeis. Como o estudante optou por cursar administração na instituição que não havia assumido os alunos desse curso, ele teve de arcar com as despesas da transferência e por isso pediu na Justiça o ressarcimento de tais gastos, além de indenização pelo dano moral decorrente do encerramento do curso. A Associação Nóbrega de Educação e Assistência Social, responsável pela faculdade, alegou que agiu amparada no princípio da autonomia universitária, previsto no artigo 53, I, da Lei 9.493/96 (Lei de Diretrizes e Bases da Educação). Também sustentou que o encerramento não gerou danos ao aluno, pois foram feitos convênios com outras entidades e garantidas as mesmas condições de pagamento. Danos morais: A sentença condenou a associação ao pagamento de indenização por danos morais no valor de R$ 10.200. As partes apelaram para o Tribunal de Justiça de São Paulo (TJSP), uma em defesa da legalidade do seu proceder e a outra pleiteando o aumento do valor. O tribunal paulista afirmou que a autonomia universitária permite a extinção de cursos, mas mesmo assim a instituição deveria indenizar o aluno prejudicado, que sofreu danos morais em razão da quebra de sua expectativa de fazer o curso até o fim na faculdade que escolheu. De acordo com o ministro Paulo de Tarso Sanseverino, relator do recurso, era preciso ofertar alternativas ao aluno, com iguais condições e valores, para minimizar os prejuízos gerados com a frustração por não mais poder cursar a faculdade escolhida. Precedente: Embora haja precedente em sentido contrário na Quarta Turma, o caso possui peculiaridades diferentes. Naquele julgamento (REsp 1.094.769), o entendimento que prevaleceu foi o de que a extinção do curso superior não violou os deveres da boa-fé contratual, pois a instituição forneceu adequada e prévia informação aos alunos e ainda ofereceu alternativas em iguais condições e valores. Sanseverino explicou que nos dois casos foi “inevitável” fazer uma análise com base no Código de Defesa do Consumidor, para saber da existência ou não de defeito na prestação do serviço – informações prestadas e forma como se deu a rescisão contratual. O ministro afirmou que essa análise deveria ser feita em conjunto com o artigo 187 do Código Civil de 2002, segundo o qual “comete ato ilícito quem se excede manifestamente no exercício do seu direito”. Abuso: Sanseverino ressaltou que não está em questão discutir a autonomia universitária para extinguir cursos, mas sim avaliar “se houve ou não excesso no exercício desse direito”. Segundo o ministro, tanto o juiz como o colegiado paulista reconheceram o excesso na forma como se deu o encerramento do curso superior, pois foi feito de forma “abrupta”, caracterizando o abuso de direito vedado pelo artigo 187 do CC/02. Para afastar a configuração desse abuso, como pretendia a instituição recorrente, seria necessário reanalisar as provas do processo, o que não é permitido em recurso especial. Com isso, a associação de educação terá de indenizar o aluno por dano moral decorrente do exercício abusivo de seu direito. Fonte Notícia:http://www.stj.jus.br/sites/STJ/default/pt_BR/sala_de_noticias/noticias/Destaques/Faculdade-ter%C3%A1-de-indenizar-aluno-por-encerramento-repentino-de-curso','indenização, faculdade','universitarios.jpg','2014-11-07'),(8,'Baixe o aplicativo para celular do Cadastro Nacional dos Advogados','Brasília – O Cadastro Nacional dos Advogados (CNA) já pode ser consultado por smartphones e tablets. Para isso, basta o usuário instalar gratuitamente o aplicativo que está disponível nos sistemas IOS e Android. Ele pode ser baixado na Apple Store ou Google Play. O CNA é mantido pelo Conselho Federal da Ordem dos Advogados do Brasil (OAB) e nele pode ser pesquisados profissionais inscritos no país. A consulta pode ser por nome, seccional, número da inscrição e tipo de inscrição, se estagiário, advogado ou suplementar. O presidente nacional da entidade, Marcus Vinicius Furtado Coêlho destacou que o aplicativo não teve custos adicionais, pois foi desenvolvida pelo departamento de Tecnologia da Informação da OAB. “O objetivo foi disponibilizar uma ferramenta mais rápida e adequada” Fonte: http://www.oab.org.br/noticia/27546/baixe-o-aplicativo-para-celular-do-cadastro-nacional-dos-advogados',NULL,'cna advogado.jpg','2014-11-13'),(9,'Morre em São Paulo o ex-ministro da Justiça Márcio Thomaz Bastos','O advogado e ex-ministro da Justiça Márcio Thomaz Bastos, de 79 anos, morreu na manhã desta quinta-feira (20) no Hospital Sírio-Libanês, em São Paulo. A informação foi confirmada pela equipe médica. Bastos foi internado na terça-feira (18) para tratamento de descompensação de fibrose pulmonar, segundo boletim médico divulgado pelo hospital. Um dos advogados criminalistas mais influentes do país, Bastos foi convidado pelo ex-presidente Luiz Inácio Lula da Silva para compor a equipe do primeiro mandato. Comandou o Ministério da Justiça entre 2003 e 2007. Mesmo depois de deixar o ministério, continuou em evidência ao atuar em casos de grande repercussão nacional. Atuou, por exemplo, no julgamento do processo do mensalão, no Supremo Tribunal Federal, em 2012. Na ocasião, defendeu o ex-vice-presidente do Banco Rural, José Salgado. Durante o período do julgamento, entrou com reclamação contra o então presidente do STF, Joaquim Barbosa, questionando o fato de Barbosa não ter levado pedidos da defesa dos réus para análise do plenário do tribunal. Também foi o responsável pela defesa do bicheiro Carlinhos Cachoeira, que responde a processo por suspeita de participação em esquema de jogos ilegais. Bastos atuou ainda na defesa do médico Roger Abdelmassih, condenado a 278 anos de prisão por 48 ataques sexuais a 37 vítimas. A acusação dos assassinos de Chico Mendes, do cantor Lindomar Castilho e do jornalista Pimenta Neves são outros trabalhos de repercussão nacional no currículo do ex-ministro. Em 2012, Bastos foi contratado pelo empresário Eike Batista para defender o filho Thor Batista, que respondia por um atropelamento. O ex-ministro se formou na Faculdade de Direito da Universidade de São Paulo (USP) na turma de 1958. Em 1990, após a eleição do presidente Fernando Collor, integrou o governo paralelo instituído pelo Partido dos Trabalhadores como encarregado do setor de Justiça e Segurança. Em 1992, participou ao lado do jurista Evandro Lins e Silva da redação da petição que resultou no impeachment de Collor. É fundador do movimento Ação pela Cidadania, juntamente com Severo Gomes, Jair Meneghelli e Dom Luciano Mendes de Almeida. É fundador do Instituto de Defesa do Direito de Defesa. Fonte:http://g1.globo.com/sao-paulo/noticia/2014/11/morre-em-sao-paulo-o-ex-ministro-da-justica-marcio-thomaz-bastos.html','Marcio Thomas Bastos','marcio-thomas-bastos.jpg','2014-11-20'),(10,'Novo CPC garante conquistas históricas para a advocacia','Brasília – O novo Código de Processo Civil, cujo texto base foi aprovado nesta terça-feira (17) pelo Senado Federal, apresenta uma série de mudanças que beneficiarão todos os advogados do país, tanto os privados quanto os públicos. “É sem dúvida um dos momentos mais importantes vividos pela advocacia”, avaliou o presidente da OAB Nacional, Marcus Vinicius Furtado Coêlho. Nesta quarta-feira (17) os senadores votarão os destaques e o texto então seguirá para sanção presidencial. Marcus Vinicius Furtado foi um dos 12 juristas da comissão responsável por elaborar o anteprojeto do Código de Processo Civil. Os trabalhos tiveram início no fim de 2009, tendo sido realizadas audiências públicas em todo o país. “A advocacia brasileira agrade aos parlamentares e aos membros da comissão de juristas, na pessoa do ministro Bruno Dantas, pelo acolhimento das bandeiras da classe que valorizam a profissão”, afirmou o presidente da OAB. O novo Código de Processo Civil, o primeiro elaborado em uma democracia e que substituirá texto usado há mais de 40 anos, estabelece os honorários como obrigação alimentar, com privilégios iguais aos créditos trabalhistas no processo e na execução da cobrança judicial. Também adota tabela de honorários com critérios mais objetivos nas causas contra a Fazenda Pública, além de escalonamento para impedir o arbitramento de honorários em valores irrisórios. De acordo com o novo CPC, os honorários serão fixados entre o mínimo de 10% e o máximo de 20% sobre o valor da condenação, do proveito econômico obtido ou, não sendo possível fazer essa mensuração, sobre o valor atualizado da causa. Porém, nas causas contra a Fazenda Pública será aplicada tabela específica, com percentuais decrescentes a depender do valor da condenação ou do proveito econômico comparável a números múltiplos do salário mínimo. Na menor faixa, o mínimo a receber será de 10% e o máximo de 20% sobre o valor da condenação. Para causa com valores altos, o juiz poderá fixar percentual entre 1% e 3% sobre o valor da condenação ou do proveito econômico obtido acima de cem mil salários mínimos. O CPC também deixa claro em sua nova redação que os honorários de sucumbência são devidos ao advogado e não à parte vencedora, como alguns juízes entendem com o texto atual. Além disso, esses honorários serão pagos também durante a fase recursal, ou seja, serão ampliados durante esta etapa em função do trabalho extra do advogado. Uma antiga reivindicação da advocacia pública será contemplada com o novo CPC: o direito a honorários de sucumbência. A nova regra deverá ser estabelecida por lei específica. Marcus Vinicius, presidente da OAB Nacional, também comemorou a inclusão no CPC da suspensão de prazos entre 20 de dezembro e 20 de janeiro, o que garantirá por lei o direito às férias dos advogados. “Agora, os advogados de todo o país terão direito ao merecido descanso sem terem de se preocupar com a perda de audiências ou de prazos. Essa é uma grande conquista da advocacia brasileira e faz justiça com profissionais que atuam cotidianamente com inúmeras responsabilidades, como a liberdade, os direitos e o patrimônio da sociedade. Função que merece todo o cuidado por parte dos profissionais da advocacia”, disse. A contagem de prazos em dias úteis também está garantida pelo CPC, o que facilitará o trabalho cotidiano dos milhares de advogados que militam no Brasil. Também está assegurada a ordem cronológica para julgamentos e a intimação na sociedade de advogados, além da carga rápida em seis horas. Também entrará em vigor um procedimento único para a sentença, menos burocrático e mais célere, mantendo assegurado o direito de defesa. O novo CPC beneficia advogados, mas também cria ferramentas para lidar com demandas e acelerar a Justiça, altera o processo de ações de família e regulamenta a gratuidade da Justiça. O texto entrará em vigor um ano após a sanção, para que o Judiciário e a sociedade possam se adequar às novas regras. Para a presidente da Comissão Especial do Novo CPC, que reuniu importantes nomes da advocacia na OAB, Estefânia Viveiros, o código apresenta sinais de avanço e modernização. “Muitas conquistas obtidas pela OAB e pelos advogados foram incorporadas ao CPC, sempre com a preocupação do papel do advogado, que é indispensável à administração da justiça”, avaliou, durante a tramitação do projeto na Câmara. Os processos de natureza civil tratam dos conflitos entre as pessoas e também de causas envolvendo bens, herança e família, entre outros. O novo CPC tem como objetivo dar celeridade à tramitação dessas causas. A vigência terá início depois de um ano da publicação oficial, consolidando novas regras em relação aos processos da área civil, como prazos e recursos cabíveis e como os juízes e outros agentes devem atuar durante o curso da ação. Com informações da Agência Senado FONTE NOTICIA: http://www.oab.org.br/noticia/27947/novo-cpc-garante-conquistas-historicas-para-a-advocacia',NULL,'','2015-01-05'),(11,'Condomínio terá de pagar danos morais à família de vítima de descarga elétrica','A Terceira Turma do Superior Tribunal de Justiça (STJ) manteve decisão que condenou um condomínio da cidade de Itajaí (SC) a indenizar a família de um pedreiro morto por descarga elétrica na casa de força do prédio. O colegiado não considerou exagerado o montante de R$ 270 mil, que será dividido entre a mãe e a companheira da vítima. O pedreiro foi contratado pelo condomínio para fazer um conserto em sua casa de força. Ao entrar ali, foi atingido por descarga elétrica que causou morte instantânea. A mãe da vítima e sua companheira ajuizaram ações indenizatórias. Culpa concorrente A sentença afastou a ideia de culpa exclusiva da vítima. De acordo com os depoimentos prestados no inquérito policial, a vítima contribuiu para a ocorrência do evento, pois não obedeceu às normas que restringiam o acesso ao local. Porém, segundo o juízo de primeiro grau, a culpa do pedreiro seria concorrente, uma vez que o porteiro do edifício permitiu sua entrada e até lhe abriu a porta. O valor dos danos morais estabelecido na sentença foi de R$ 150 mil para cada uma, com correção monetária a partir do arbitramento e juros de mora desde a data do evento (novembro de 2005). Na apelação, o Tribunal de Justiça de Santa Catarina (TJSC) reduziu o valor da indenização para R$ 135 mil para cada uma, o que representou um montante global condenatório de 900 salários mínimos vigentes à época do acidente. Reexame dos fatos Inconformado, o condomínio entrou com recurso especial no STJ buscando o reconhecimento da culpa exclusiva da vítima e, subsidiariamente, postulou a redução do valor indenizatório. Em seu voto, o relator, ministro Paulo de Tarso Sanseverino, destacou que o tribunal estadual, ao manter a condenação do condomínio, afastou a alegação de culpa exclusiva da vítima, reconhecendo, porém, que o pedreiro concorreu para o evento. De acordo com o ministro, só mediante o reexame das provas – que é vedado pela Súmula 7 do STJ – seria possível, eventualmente, reconhecer a exclusividade da culpa da vítima e assim afastar a culpa concorrente (apontada tanto na sentença quanto no acórdão). Sobre o valor indenizatório, o ministro considerou razoável o que foi estabelecido pelo tribunal estadual. “Está pacificado o entendimento desta corte superior no sentido de que o valor da indenização por dano moral somente pode ser alterado na instância especial quando ínfimo ou exagerado, o que não ocorre no caso em tela, em que foram consideradas as peculiaridades, arbitrando-se a indenização em valor razoável em relação à extensão do dano sofrido”, afirmou Sanseverino. Fonte:http://www.stj.jus.br/sites/STJ/default/pt_BR/sala_de_noticias/noticias/Destaques/Condom%C3%ADnio-ter%C3%A1-de-pagar-danos-morais-%C3%A0-fam%C3%ADlia-de-v%C3%ADtima-de-descarga-el%C3%A9trica',NULL,'','2015-01-06'),(12,'OAB realizará, em março, a I Conferência Nacional do Jovem Advogado','Brasília – Entre os dias 19 e 20 de março de 2015, o Centro de Convenções do município de Porto Seguro (BA) será o palco da I Conferência Nacional do Jovem Advogado, realizada pela OAB Nacional em parceria com a seccional baiana da Ordem. O tema da primeira edição do evento será “Empreendedorismo Jurídico e Cidadania”. O objetivo é debater as demandas e expectativas dos advogados em início de carreira, bem como orientá-los, ouvi-los e prepará-los para o mercado de trabalho. Para o presidente nacional da OAB, Marcus Vinicius Furtado Coêlho, a valorização do advogado em início de carreira é fundamental para o fortalecimento da advocacia. “Os jovens advogados, ao mesmo tempo que possuem uma grande disposição para trabalhar e uma grande paixão pela profissão, enfrentam muitas dificuldades. É trabalho da OAB melhorar o ambiente para esses profissionais”, afirmou. Nos próximos dias, a OAB Nacional divulgará a programação completa e os nomes dos palestrantes que conduzirão as atividades na I Conferência Nacional do Jovem Advogado, entre eles o jurista Fred Didier Júnior. Os inscritos terão palestras, workshops e minicursos gratuitos sobre empreendedorismo jurídico, oratória jurídica, sociedades de advogados, novo CPC, entre outros temas. O encerramento do evento contará com uma grande festa animada por um trio elétrico. PLANO NACIONAL Recentemente, por ocasião de reunião ordinária de seu Colégio de Presidentes, a OAB aprovou a criação do Plano Nacional de Apoio ao Jovem Advogado Brasileiro, um documento que apresenta propostas para fortalecer o ensino jurídico no país, a defesa das prerrogativas e políticas de anuidades diferenciadas. Fonte: http://www.oab.org.br/noticia/27970/oab-realizara-em-marco-a-i-conferencia-nacional-do-jovem-advogado',NULL,'','2015-01-10');

